import firebase from "../firebase"


export const postComment = (formData)=>{
const rootRef = firebase.database().ref("/")
const mesagges =rootRef.child("messages")
mesagges.push({
    name:"melina",
    subject:"Solicitud brancing",
    service:"design",
    message:"quiero eso"
})

}
